import React from "react"
import soup_logo from "./soup_logo.jpg"

export default function DailySoup(props){
  return(
    <div className="daily_soup_card">
      <h2 className="daily_soup_title">{props.title}</h2>
      <img src={props.img} width="60%" className="daily_soup_img"/>
      <p className="daily_soup_description">{props.description} </p>



    </div>
  )
}
